import React, { useState } from 'react';
import './App.css';

function App() {
  const [count, setCount] = useState(0);

  const ic = () => {
    setCount(count + 1);
  }
  const ic10 = () => {
    setCount(count + 1);
  }
  const dc = () => {
    setCount(count - 1);
  }
  const rc = () => {
    setCount(0);
  }

  return (
    <div style={{textAlign:"center",marginTop:"50px"}}>
      <h1>Counter Program</h1>
      <h2>{count}</h2>
        <div className='btng'>
        <button onClick={ic10} className='btn'>↑+10</button>
        <button onClick={ic} className='btn'>↑</button>
        <button onClick={rc} className='btn'>↻</button>
        <button onClick={dc} className='btn'>↓</button>
        <button onClick={dc} className='btn'>↓-10</button>
        </div>
    </div>
  );
}
export default App;
